import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Blog from "../pages/blogs/Blog";

function FooterRoutes() {
  return (
    <div>
      <Router>
        <Switch>
          <Route to="/blog"><Blog /></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default FooterRoutes;
